const prefix = 'alert-confirm';

function decorateProps(props) {
	const {
		onOkHide = () => {},
		onCancelHide = () => {},
		okText = '确定',
		cancelText = '取消',
		className,
		...rest
	} = props;
	let clazz = classNames(prefix, {
		[className]: className
	});
	let buttons = [{
		children: cancelText,
		onClick: onCancelHide
	}, {
		children: okText,
		onClick: onOkHide
	}];

	return {
		className: clazz,
		buttons: buttons,
		...rest
	};
}

export default function Confirm(props) {
	const {
		children,
		...alertProps
	} = decorateProps(props);

	return (
		<Alert 
			{...alertProps}
		>
			{children}
		</Alert>
	);
}

Confirm.show = (props) => {
	const alertProps = decorateProps(props);

	Alert.show(alertProps);
};

Confirm.propTypes = {
	onOkHide: PropTypes.func,
	onCancelHide: PropTypes.func,
	okText: PropTypes.node,
	cancelText: PropTypes.node
};
