	} = props;
	let clazz = {
		[prefix + value]: true,
		[prefix + sizeType]: !!sizeType,
		[className]: className
	};
	let style = {};

	if(size) {
		style = {
			width: size,
			height: size,
			fontSize: size
		};
	}

	return (
		<i className={classNames(clazz)} style={style} {...rest}>
			{children}
		</i>
	);
}

