			transitionLeaveTimeout={duration}
			transitionName={transitionName}
			transitionAppear={true}
		>
			{visible ? (
				<div
					className={classNames(prefix)}
					style={newStyle}
					key={'popup'}
				>
					<div 
						className={clazz} 
						style={{...newStyle, ...style}}
						{...rest}
					>
						{children}
					</div>
				</div>
			) : null}
		</ReactCSSTransitionGroup>
	);
}

